import { Button, FormControl, TextField } from "@mui/material";
import { useState } from "react";

const data={
    name:"",
    email:"",
    password:''
}

const fieldChange=(e)=>{
    setInput(e.target.value)
}
function Form() {
    const [input,setInput]=useState(data);
  return (
    <>
    <FormControl>
        <TextField 
            name="name"
            type='text' 
            placeholder='name' 
            sx={{margin:'20px'}}
            value={input.name}
            onChange={fieldChange}
            
        />
        <TextField 
            name="email"
            type='email' 
            placeholder='email'  
            sx={{margin:'20px'}} 
        />
        <TextField 
            name='password'
            type="password"
            placeholder='password'  
            sx={{margin:'20px'}}
        />
        <Button variant="contained">Submit</Button>

    </FormControl>
      
    </>
  )
}

export default Form;
